import React, { Component } from 'react'
import { Navbar, Nav, NavItem } from 'react-bootstrap';
import { Link } from 'react-router-dom';


export default class Navigator extends Component {
    render() {
        return (
        <Navbar default collapseOnSelect>
            <Navbar.Header>
            <Navbar.Brand>
                <Link to="/">MEETEXO</Link>
            </Navbar.Brand>
            <Navbar.Toggle />
            </Navbar.Header>
            <Navbar.Collapse>
                <Nav pullRight>
                    <NavItem eventKey = {1} componentClass={Link}  to="/">
                    Memebers
                    </NavItem>
                    {/* <NavItem eventKey = {2} componentClass={Link} to="/discography">
                    Discography
                    </NavItem>
                    <NavItem eventKey = {3} componentClass={Link}  to="/members">
                    Tests
                    </NavItem> */}
                </Nav>

            </Navbar.Collapse>
        </Navbar>

        )
    }
}
